import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import 'bulma/bulma';

class List extends Component {
  render() {
    return (
      <div>
        <ul>
          {this.state.list.map(item => (
            <li key={item}>
              {item} &nbsp;
                  <span
                className="delete"
                onClick={() => this.removeItem(item)}
              />
            </li>
          ))}
        </ul>
      </div>
    )
  }
}

export default List;
